Prezentujemy najnowszy teledysk South Blunt System zrealizowany do utworu "Była chłodna". Klip promuje nadchodzący album ekipy zatytułowany "I'm Seeing".

South Blunt System to zespół założony w Nysie, któremu przoduje 18-letni wokalista Szymon Chodyniecki. Szymona zapewne mieliście okazję wcześniej usłyszeć w singlach z płyty Chady "Jeden z Was" (utwory "Syf tych ulic", "Niesiemy Prawde 2", "Już Ci mówię").

Podziękowania dla:
- Zakład Karny w Nysie
- STEP RECORDS
- Sklep "Szczęście"
- OMS Renata Tchórzewska, okręg 317, AVON

